import React from "react";
import { Section, StyledTitle } from "./styles";
import { TitleSize } from "../../ui/title/title";

function News() {
    return (
        <Section>
            <StyledTitle size={TitleSize.MEDIUM}>Новости</StyledTitle>
        </Section>
    )
}

export default News;
